attributes.style:
.boxy-wrapper { position: absolute; }
.boxy-wrapper.fixed { position: fixed; }
.boxy-modal-blackout { position: absolute; background-color: black; left: 0; top: 0; }

.boxy-wrapper .title-bar {
position: relative;
background-color: #fff !important;
margin-left:12px !important;
margin-right:12px !important;
margin-top:8px !important;
padding-bottom:8px !important;
text-align:left;
font-weight:normal;
border-bottom:1px solid #e5e5e5;

}
.boxy-wrapper .title-bar h2{
font-size:24px;
text-align:left;
font-weight:normal;
margin:0;
padding:0;
}

.boxy-wrapper .title-bar a.close{
outline: none;
position: absolute;
background: url("/3938bd92-e009-2767-09e2-1da56035c24a.png") -95px -128px;
height: 18px;
width: 19px;
top: 6px;
right: 6px;
display:none !important;
}
.boxy-wrapper .title-bar a.close:hover{
border: 1px inset #999999;
}

.boxy-inner {
border:0 !important;
background-color:#fff !important;
box-shadow: 0 0 40px #000;
-moz-box-shadow: 0 0 40px #000;
-webkit-box-shadow: 0 0 40px #000;
background: url("/ac84402d-b5d7-dcc7-fb33-357b0426918f.png") left bottom repeat-x;
}
